tables.table_schema:
CREATE TABLE participants (
  participant_id INT PRIMARY KEY,
  participant_name TEXT,
  age INT,
  gender TEXT
);

CREATE TABLE outcomes (
  outcome_id INT PRIMARY KEY,
  participant_id INT,
  outcome_text TEXT,
  outcome_date DATE
);

CREATE TABLE Participants (
  id INT PRIMARY KEY,
  name VARCHAR(255),
  age INT,
  program_id INT
);

CREATE TABLE Outcomes (
  outcome_id INT PRIMARY KEY,
  participant_id INT,
  outcome_description TEXT,
  outcome_date DATE
);

CREATE TABLE Feedback (
  feedback_id INT PRIMARY KEY,
  participant_id INT,
  feedback_text TEXT
);

CREATE TABLE participants (
    participant_id INT PRIMARY KEY,
    participant_name VARCHAR(50),
    program_id INT,
    JOIN date DATE
);

CREATE TABLE programs (
    program_id INT PRIMARY KEY,
    program_name VARCHAR(50),
    program_type VARCHAR(50),
    program_date DATE
);

CREATE TABLE outcomes (
    outcome_id INT PRIMARY KEY,
    outcome_name VARCHAR(50),
    program_id INT,
    outcome_date DATE
);

CREATE TABLE program_participation (
    participation_id INT PRIMARY KEY,
    program_id INT,
    participant_id INT,
    participation_date DATE
);
